import React from 'react';

const List = props => {
    const songs = props.songs.map(song => (
    <div key={song.album}>
    
        <h4>{`${song.na}${song.year}`}</h4>
        
        </div>
            ))
    return ( 
    
        <ul>{songs}</ul>
         );
}
 
export default List;
